// --- Sound Asset Data ---
// Sound assets are provided as placeholders. The user can replace the empty
// strings with base64 encoded data URLs to enable sounds.
// The SoundManager will safely skip any empty sources.
const sounds = {
    MOVE: 'data:audio/mpeg;base64,',       // placeholder for move sound
    CAPTURE: 'data:audio/mpeg;base64,',    // placeholder for capture sound
    CHECK: 'data:audio/mpeg;base64,',      // placeholder for check sound
    CHECKMATE: 'data:audio/mpeg;base64,',  // placeholder for checkmate sound
    UI_CLICK: 'data:audio/mpeg;base64,',   // placeholder for UI click sound
    ERROR: 'data:audio/mpeg;base64,',      // placeholder for error sound
};

type SoundName = keyof typeof sounds;

class SoundManager {
    private audioCache: { [key in SoundName]?: HTMLAudioElement } = {};
    private isEnabled = true;
    private isInitialized = false;

    constructor() {
        // Load initial settings from localStorage if available
        const savedSoundSetting = localStorage.getItem('soundEnabled');
        this.isEnabled = savedSoundSetting !== 'false';
    }

    /**
     * Initializes the sound manager and preloads audio files.
     * This should be called after a user interaction to comply with browser autoplay policies.
     */
    public init() {
        if (this.isInitialized) return;

        console.log('Initializing Sound Manager...');
        for (const key in sounds) {
            const soundName = key as SoundName;
            const src = sounds[soundName];
            // Only try to load audio if a valid data URL is provided.
            if (src && src.startsWith('data:audio')) {
                try {
                    const audio = new Audio(src);
                    audio.load(); // Preload the audio
                    this.audioCache[soundName] = audio;
                } catch (e) {
                    console.error(`Failed to create or load audio for ${soundName}`, e);
                }
            }
        }
        this.isInitialized = true;
    }

    /**
     * Plays a sound if it's enabled and the sound exists.
     * @param soundName The name of the sound to play.
     */
    public play(soundName: SoundName) {
        if (!this.isEnabled || !this.isInitialized) return;

        const audio = this.audioCache[soundName];
        if (audio) {
            audio.currentTime = 0;
            audio.play().catch(error => console.error(`Error playing sound: ${soundName}`, error));
        }
    }

    /**
     * Enables or disables all sound playback and persists the setting.
     * @param enabled A boolean to set the sound state.
     */
    public setEnabled(enabled: boolean) {
        this.isEnabled = enabled;
        localStorage.setItem('soundEnabled', String(enabled));
    }
}

// Export a single instance of the SoundManager to be used throughout the app.
export const soundManager = new SoundManager();
